import React, { useState } from 'react';
import './Header.css';

function Header({ navigateTo }) {
  const [showConcernMenu, setShowConcernMenu] = useState(false);
  const [showHairTypeMenu, setShowHairTypeMenu] = useState(false);

  const toggleConcernMenu = () => {
    setShowConcernMenu(!showConcernMenu);
    setShowHairTypeMenu(false);
  };

  const toggleHairTypeMenu = () => {
    setShowHairTypeMenu(!showHairTypeMenu);
    setShowConcernMenu(false);
  };

  const handleConcernClick = (concern) => {
    console.log(`Selected concern: ${concern}`);
    navigateTo(concern.toLowerCase().replace(' ', '-'));
    toggleConcernMenu();
  };

  const handleHairTypeClick = (hairType) => {
    console.log(`Selected hair type: ${hairType}`);
    if (hairType === 'Straight Hair') {
      navigateTo('straight-hair');
    } else {
      navigateTo(hairType.toLowerCase().replace(' ', '-'));
    }
    toggleHairTypeMenu();
  };

  const handleQuizClick = () => {
    navigateTo('quiz');
  };

  const handleCartClick = () => {
    navigateTo('cart');
  };

  return (
    <>
      <div className="announcement-bar">
        Free Shipping on Orders over $50
      </div>
      <header className="home-header">
        <a href="#" className="home-title-link" onClick={() => navigateTo('home')}>
          <h1>HAIR HAVEN</h1>
        </a>
        <nav className="home-menu">
          <ul>
            <li><a href="#" onClick={() => navigateTo('products')}>PRODUCTS</a></li>
            <li>
              <div className="dropdown">
                <a href="#" onClick={toggleConcernMenu}>SHOP BY CONCERN</a>
                {showConcernMenu && (
                  <div className="dropdown-content">
                    <a href="#" onClick={() => handleConcernClick('bleached-hair')}>Bleached Hair</a>
                    <a href="#" onClick={() => handleConcernClick('Curly Hair')}>Curly Hair</a>
                    <a href="#" onClick={() => handleConcernClick('Damaged Hair')}>Damaged Hair</a>
                    <a href="#" onClick={() => handleConcernClick('Dry Hair')}>Dry Hair</a>
                    <a href="#" onClick={() => handleConcernClick('Eco-Friendly')}>Eco-Friendly</a>
                    <a href="#" onClick={() => handleConcernClick('Frizzy Hair')}>Frizzy Hair</a>
                  </div>
                )}
              </div>
            </li>
            <li>
              <div className="dropdown">
                <a href="#" onClick={toggleHairTypeMenu}>SHOP BY HAIR TYPE</a>
                {showHairTypeMenu && (
                  <div className="dropdown-content">
                    <a href="#" onClick={() => handleHairTypeClick('Straight Hair')}>Straight Hair</a>
                    <a href="#" onClick={() => handleHairTypeClick('Curly Hair')}>Curly Hair</a>
                    <a href="#" onClick={() => handleHairTypeClick('Fine Hair')}>Fine Hair</a>
                    <a href="#" onClick={() => handleHairTypeClick('Thick Hair')}>Thick Hair</a>
                  </div>
                )}
              </div>
            </li>
            <li><a href="#" onClick={handleQuizClick}>QUIZ</a></li>
          </ul>
        </nav>
        <div className="cart-icon" onClick={handleCartClick}>
          <img src="/cart-icon.png" alt="Cart" />
        </div>
      </header>
    </>
  );
}

export default Header;
